import './App.css';
import TopBar from './components/topbar';
import banner from './assets/document.jpeg'

function App() {
  return (
  <div className='flex-1 flex-col justify-items-center max-h-full'>
    <TopBar/>

    <img src={banner} alt='banner' className='my-5'/>

  </div>  );
}

export default App;
